// Home Page
import React from "react";
import "../css/Home.css";
import { IconSearch } from '@tabler/icons-react';

function Home() {
    return (
        <div className="HomePage">
            <div className="header">

                <div className="first-header">
                    <div className="logo">
                        <img src="/images/logo.png" alt="logo" style={{height: "40px", paddingTop: "0.7rem", paddingLeft: "0.9rem"}}/>
                    </div>
                    <div className="search-bar">
                        <IconSearch stroke={2} />
                        <input placeholder="Search Facebook" type="Search" />
                    </div>
                </div>
                <div className="nav-bar">
                    <div className="Icon">

                    </div>
                </div>
            </div>
        </div>
    )
}

export default Home;
